import './App.css';
import axios from 'axios';
import { useState, useEffect } from 'react';
function App() {

  const [people, setPeople] = useState([])

  useEffect(()=> {
    axios.get('http://localhost:8000/api').then(res => setPeople(res.data));
  }, []);
  return people.map((p, index) => {
    return "hello world"
  })
}

export default App;
